import React from "react";
import { useNavigate } from "react-router-dom";
import "./styles.css";

const Home = () => {
    const navigate = useNavigate();

    const handleNavigate = (path) => {
        navigate(path);
    };

    return (
        <div className="home-container">
            <nav className="navbar">
                <h1 className="blog-title">Blog Name</h1>
                <div className="auth-buttons">
                    <button onClick={() => navigate("/login")}>Login</button>
                    <button onClick={() => navigate("/register")}>Register</button>
                </div>
            </nav>

            <div className="category-section">
                <div className="category-row">
                    <div className="category" onClick={() => handleNavigate("/travel")}>Travel</div>
                    <div className="category" onClick={() => handleNavigate("/food")}>Food</div>
                </div>
                <div className="category-row">
                    <div className="category" onClick={() => handleNavigate("/movies")}>Movies</div>
                    <div className="category" onClick={() => handleNavigate("/games")}>Games</div>
                </div>
            </div>
        </div>
    );
};

export default Home;
